    return (
        <div>
                {/* left clone */}
      <div className="left-clone">
        <FaFacebook className="fb-logo"></FaFacebook>
        <div className="search">
          <FaSearch style={{height:'15px',width:'15px',color:'gray'}}></FaSearch>
          <div >
          <input 
          placeholder='search facebook'>
          </input>
          </div>
        </div>

      </div>
        </div>
    )
}

export default serachbar
